script: |
  super -f text -I q6636.spq | sort > q6636.out

inputs:
  - name: q6636.spq
    data: |
      SELECT col2 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + ( - col0 ) * 82 * - + 65 + - col2 + + 31 * - + 85 <= - col1 * + col0 - + - 34;
  - name: tab2

outputs:
  - name: q6636.out
    data: |
      23
      40
      58
